document.addEventListener("DOMContentLoaded",(function(){[].slice.call(document.querySelectorAll("[data-bss-tooltip]")).map((function(e){return new bootstrap.Tooltip(e)}))}),!1),document.querySelectorAll(".carousel").forEach((e=>{const o=e.querySelector(".carousel-inner"),t=e.querySelector(".carousel-control-next"),l=e.querySelector(".carousel-control-prev");if(window.matchMedia("(min-width:576px)").matches){const e=o.scrollWidth,c=o.querySelector(".carousel-item").offsetWidth;let r=0;t.addEventListener("click",(()=>{r<e-c&&(r+=c,o.scrollTo({left:r,behavior:"smooth"}))})),l.addEventListener("click",(()=>{r>0&&(r-=c,o.scrollTo({left:r,behavior:"smooth"}))}))}else e.classList.add("slide")}));